import React from "react";

function Analytics() {
  return (
    <div>
      <p
        style={{
          color: "#5076FF",
          fontWeight: "600",
          fontSize: "2.5em",
          textAlign: "center",
          marginTop: "10vh",
        }}
      >
        Quiz Analysis
      </p>
      <p
        style={{
          width: "66vw",
          marginLeft: "7vw",
          marginRight: "7vw",
          color: "#FFFFFF",
          backgroundColor: "#5076FF",
          marginTop: "8vh",
          borderRadius: "10px",
          fontSize: "1.1em",
          paddingTop: "1.1vh",
          paddingBottom: "1.1vh",
          fontWeight: "600",
        }}
      >
        <span
          style={{
            marginLeft: "1.5vw",
            width: "5vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          S.No
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Quiz Name{" "}
        </span>
        <span
          style={{
            width: "14vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Created on
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Impression
        </span>
      </p>

      <p
        style={{
          width: "66vw",
          marginLeft: "7vw",
          marginRight: "7vw",
          color: "#000000",
          borderRadius: "10px",
          fontSize: "1.1em",
          paddingTop: "1.1vh",
          paddingBottom: "1.1vh",
          fontWeight: "600",
        }}
      >
        <span
          style={{
            marginLeft: "1.5vw",
            width: "5vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          1
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Quiz 1
        </span>
        <span
          style={{
            width: "14vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          01 Sep, 2023
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          345
        </span>
        <span
          style={{
            marginLeft:"1vw",
            width: "6vw",
            height:"5vh",
            display: "inline-block",
            textAlign: "center",
            backgroundColor: "pink",
          }}
        >H</span>
      </p>

      <p
        style={{
          width: "66vw",
          marginLeft: "7vw",
          marginRight: "7vw",
          color: "#000000",
          backgroundColor: "#B3C4FF",
          borderRadius: "10px",
          fontSize: "1.1em",
          paddingTop: "1.1vh",
          paddingBottom: "1.1vh",
          fontWeight: "600",
        }}
      >
        <span
          style={{
            marginLeft: "1.5vw",
            width: "5vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          2
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Quiz 2
        </span>
        <span
          style={{
            width: "14vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          04 Sep, 2023
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          2000
        </span>
      </p>
    </div>
  );
}

export default Analytics;
